import React from "react";
import FourHourCast from "./FourHourCast";
import { FontAwesomeIcon } from '@fortawesome/react-fontawesome';
import {icon } from '@fortawesome/fontawesome-svg-core/import.macro' 



const FiveDayForecast = ({day, forecast})=>{
let keys;

    if (!forecast){
        console.log("not loaded");
    }
    else{
        keys=Object.keys(forecast);
        console.log(keys);
    }


    return (
        <div className="weatherContainer">
        <div className="dayOfWeek"> 
        <FontAwesomeIcon icon={icon({name: 'calendar', style: 'regular'})} />
        <h4 className="day"> {day}</h4>
        <div className="borderBottom"></div>
        </div>
        {/* {
           forecast.map((data,index)=>{
            return(
                <FourHourCast key={index} time={data[index][index]} temperature="22ºc" humidity="90"/> 
            )
           })
        } */}

        <FourHourCast  time="12:00" temperature="22ºc" humidity="90"/> 
        </div>
    )
}

export default FiveDayForecast
